const getDataReducer = (state = [], {type, payload}) => {
    switch (type) {
      case "GET_DATA":
        return payload || state
      case "SET_FAV":
        var data = payload.data || {}
        console.log("payload", payload, data);
        return payload || state
      default:
        return state
    }
}

export default getDataReducer;
